import { AppBar, Typography, IconButton, Toolbar, Button ,Box, Drawer} from '@mui/material';
import React, { useState } from 'react'
import MenuRoundedIcon from '@mui/icons-material/MenuRounded';



export default function Sidebar() {
  const [opem ,setOpem] = useState(Boolean=false)
  return (
  <AppBar position='static'>
      <Toolbar>
          
      <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
            // onClick={setOpem(true)}
            >

            <MenuRoundedIcon />

          </IconButton>
          <Drawer
        variant="persistent"
        anchor="left"
       open={opem}
        // classes={{
        //   paper: classes.drawerPaper,
        // }}
      > 
      <Typography variant="h6" noWrap>
            Persistent drawer
          </Typography>

          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ mr: 2 }}
            // onClick={setOpem(false)} 
            >

            <MenuRoundedIcon />

          </IconButton>
      
      </Drawer>


        </Toolbar>
    </AppBar>




   
  )
}
